import React from 'react'

export default class MenuButton extends React.Component {
    render(){
        return(
            <div className="drop">
                <a href="#">Home</a>
                <a href="#">My Profile</a>
                <a href="#">Add Video</a>
                <a href="#">Add Playlist</a>
            </div>
        )
    }
}
